// LevelScreen.js
import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';

export default function LevelScreen({ route, navigation }) {
  const { level } = route.params;

  const goBackToHome = () => {
    navigation.goBack();
  };

  return (
    <View style={styles.container}>
      <Text style={styles.header}>Level {level}</Text>
      {/* Add your level content here */}
      <Button title="Go Back" onPress={goBackToHome} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    fontSize: 24,
    marginBottom: 20,
  },
});
